import Link from "next/link";

function Languages() {
  //?  how to go back to admin?
  //* I think we'll just have a link for them and an login page as a gateway

  return (
    <div>
      <h1>Language Selection</h1>
      <div className="langContainer">
        <Link href="">
          <a>img rus</a>
        </Link>
        <Link href="">
          <a>img lv</a>
        </Link>
        <Link href="">
          <a>img eng</a>
        </Link>
      </div>
    </div>
  );
}

export default Languages;
